import React, {
  Component
} from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import Nav from './components/Nav';
import Home2 from './components/Home2';
import About2 from './components/About2';
import Contact2 from './components/Contact2';

import './styles/base.scss';

// const logo = require('./images/sass_logo.png');//for reusability

class App extends Component {
  render() {
    return ( <
      Router >
      <
      div >
      <
      Nav / >
      <
      Switch >
      <
      Route exact path = '/'
      component = {
        Home2
      }
      /> <
      Route path = '/contact'
      component = {
        Contact2
      }
      /> <
      Route path = '/about'
      component = {
        About2
      }
      /> <
      /Switch> <
      /div> <
      /Router>
    );
  }
}

export default App;
